import { Component, OnInit } from '@angular/core';
import {TokenService} from "../../service/token.service";
import {ProductService} from "../../service/product.service";
import {FormControl, FormGroup, Validators} from "@angular/forms";
import {HttpClient, HttpEvent, HttpHeaders, HttpResponse} from "@angular/common/http";
import {map, tap} from "rxjs/operators";
import {Observable} from "rxjs";
import {environment} from "../../../environments/environment";
import Product from "../../Model/product";

@Component({
  selector: 'app-product-form',
  templateUrl: './product-form.component.html',
  styleUrls: ['./product-form.component.css']
})
export class ProductFormComponent implements OnInit {
  products: Product[] = [];
  product_codes: string[] =[];

  productForm = new FormGroup({
    name: new FormControl(''),
    category: new FormControl(''),
    preis: new FormControl(''),
    desc: new FormControl(''),
  });

  imageForm = new FormGroup({
    path: new FormControl(''),
    id: new FormControl('')
  });



  constructor(private tokenService: TokenService, private productService: ProductService, private http: HttpClient) { }
  urlProduct = environment.apiBaseUrl + '/api/v2/admin/products';

  ngOnInit(): void {
    this.runGetToken();
    this.getProductCodes();
  }

  getProductCodes(){
    this.productService.getProducts().pipe(
      tap( res =>
        {
          this.product_codes = res.map(product => product.code)
        }
      )
    ).
    subscribe(() =>  null
        // console.log(res)
    )
  }

  runGetToken(){
    // console.log(this.tokenService.getToken());
    this.tokenService.getToken()
      .subscribe(res => {
        console.log(res.token);
      })
  }

  runGetProducts(){
    this.productService.getProducts().subscribe(res => {
      console.log(res);
      this.products = res;
    });
  }

  runRemoveToken(){
    this.tokenService.removeToken();
    console.log(localStorage.getItem('jwt_token'))
  }

  collectData() {
    console.log(this.productForm.value);
    const data =
      {
        "code": this.productForm.value.name,
        "mainTaxon": `/api/v2/admin/taxons/${this.productForm.value.category}`,
        "translations": {
          "en_US": {
            "name": this.productForm.value.desc,
            "slug": this.productForm.value.preis,
            "locale": "en_US"
          }
        },
        // "images": [
        //   "/api/v2/admin/product-images/2"
        // ]
      };

     // const body = JSON.stringify(data);
    this.productService.postProduct(data).subscribe(
      res => console.log(res),
      );
  }
  runGetImages(){
      this.productService.getImages().subscribe(res => console.log(res))
  }

  runPostImage(){
    console.log(this.imageForm.value);
    const data =
      {
        "path": this.imageForm.value.path,
        "owner": "/api/v2/admin/products/" + this.imageForm.value.id
      };
    this.productService.postImage(data).subscribe( res => console.log(res));
  }


  img1 = "data:image/jpeg;base64,"
}

